script: |
  super -f text -I q2291.spq | sort > q2291.out

inputs:
  - name: q2291.spq
    data: |
      SELECT DISTINCT + + col2 FROM tab0 (FORMAT parquet) WHERE NOT ( - col2 NOT BETWEEN + + 67 * - - col1 AND - col1 ) OR NOT - col1 * + + 75 - - col1 + col0 * - + col0 * + col2 * col0 IN ( + ( - + col2 ), col1, - + 8 * col0 + + CAST ( - - col2 AS INTEGER ) );
  - name: tab0

outputs:
  - name: q2291.out
    data: |
      10
      47
      99
